      SELECT 8 * + col1 FROM tab1 (FORMAT parquet) WHERE ( + 14 * + + ( + col1 ) + + + col2 + - 81 - + col1 * - ( + col2 ) ) NOT BETWEEN 97 * + col1 AND ( - 33 );
  - name: tab1

outputs:
  - name: q9259.out
    data: |
      112
      376
      40
